void print_potential_board();
void print_stored_moves();

void find_checking_piece();

void disableAudio();
void resetAudio();
void enableAudio();
void audio_ISR();
void getKingPosition(int kingColour);

/* The assembly language code below handles CPU reset processing */
void the_reset(void) __attribute__((section(".reset")));
void the_reset(void)
/*******************************************************************************
 * Reset code. By giving the code a section attribute with the name ".reset" we
 * allow the linker program to locate this code at the proper reset vector
 * address. This code just calls the main program.
 ******************************************************************************/
{
    asm(".set noat");
    asm(".set nobreak");
    asm("movia r2, main" );
    asm("jmp r2");
}
void plot_pixel(int, int, short int);
void drawPiece(int, int, char);
void map(int, int, int*, int*);

