void main(void)
{
  short int moveRow, moveCol;
  char startedMove = 0;
  char startingRow, startingCol;
  char finalRow, finalCol;
  char moveLegal = 0;
  volatile unsigned int* LEDs = (int*) LED_BASE;
  *(LEDs) = 0;
  
  /* set front pixel buffer to Buffer 1 */
  *(pixel_ctrl_ptr + 1) = (int) &Buffer1; // first store the address in the  back buffer
  /* now, swap the front/back buffers, to set the front buffer location */
  wait_for_vsync();
  /* initialize a pointer to the pixel buffer, used by drawing functions */
  pixel_buffer_start = (int) *pixel_ctrl_ptr;
  clear_screen(); // pixel_buffer_start points to the pixel buffer
  char moveValid = 0;
  /* set back pixel buffer to Buffer 2 */
  *(pixel_ctrl_ptr + 1) = (int) &Buffer2;
  pixel_buffer_start = *(pixel_ctrl_ptr + 1); // we draw on the back buffer
  clear_screen(); // pixel_buffer_start points to the pixel buffer
  setupMouse();
  setupTimer();
  setupInterrupts();
  resetAudio();
  
  while (1) {   
      //draw board
    switch(screenNum){
      case 0: {
        drawStartingScreen();
        drawWinner();
        if(mousePressed) {
          screenNum = 1;
          mousePressed = 0;
          setupMouse();
        }
        break;
      }
      case 1: {
        clear_screen();
        drawBoard();
        drawPieces();
        if(startedMove == 1) {
          drawSelection(startingRow, startingCol, YELLOW);
          for(int i = 0; i < 8; i++) {
            for(int j = 0; j < 8; j++) {
              if(stored_moves[i][j] == 'x') {
                drawSelection(i, j, BLUE);
              }
            }
          }
        }
        drawMouse();
        if(mousePressed) {
            getMove(&moveRow, &moveCol); //get the move position
            checkMove(moveRow,moveCol,colour, &moveValid, startedMove); //check if there is a piece in that postion if just starting move
            if(moveValid == 1 && startedMove == 0) {
                startingRow = moveRow;
                startingCol = moveCol;
                startedMove = 1;
                genPotentialMoves(moveRow, moveCol);
            }
            else if(moveValid == 1 && startedMove == 1 && undoMove != 1) {
                finalRow = moveRow;
                finalCol = moveCol;
                checkLegality(finalRow, finalCol, &moveLegal);
                if(moveLegal) {
                  if(Board[finalRow][finalCol] != 'o') {
                    soundType = CAPTUREsound;
                  }
                  else {
                    soundType = MOVEsound;
                  }
                  update_board(startingRow, startingCol, finalRow, finalCol);
                  getKingPosition((colour == WHITE)? BLACK: WHITE);
                  if(is_checked(king_row, king_col)) {
                    soundType = CHECKsound;
                  }
                  colour = colour == WHITE? BLACK: WHITE;//change colour
                  //printf("%d",check_endgame());
                  if(check_endgame() == true || REMOVETHIS) {
                    gameOver = 1;
                    soundType = GAMEOVERsound;
                    //printf("Game is over");
                  }
                  enableAudio();
                  startedMove = 0;
                }
                else {
                  startedMove = 1;
                }
            }
            else if(undoMove == 1 && startedMove == 1) {
                startedMove = 0;
                undoMove = 0;
            }
            mousePressed = 0;
            setupMouse();//enable interrupts from mouse
        }
        if(gameOver == 1) {
          resetGame();
        }
        break;
      }
    }
    //make sure to enable interrupts for mouse after
    wait_for_vsync(); // swap front and back buffers on VGA vertical sync
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer	
	}
}


/* The assembly language code below handles CPU exception processing. This
 * code should not be modified; instead, the C language code in the function
 * interrupt_handler() can be modified as needed for a given application.
*/
void the_exception(void) __attribute__((section(".exceptions")));
void the_exception(void)
/*******************************************************************************
 * Exceptions code. By giving the code a section attribute with the name
 * ".exceptions" we allow the linker program to locate this code at the proper
 * exceptions vector address.
 * This code calls the interrupt handler and later returns from the exception.
 ******************************************************************************/
{
asm("subi sp, sp, 128");
asm("stw et, 96(sp)");
asm("rdctl et, ctl4");
asm("beq et, r0, SKIP_EA_DEC"); // Interrupt is not external
asm("subi ea, ea, 4"); /* Must decrement ea by one instruction
                                        * for external interupts, so that the
                                        * interrupted instruction will be run */
asm("SKIP_EA_DEC:");
asm("stw r1, 4(sp)"); // Save all registers 
asm("stw r2, 8(sp)");
asm("stw r3, 12(sp)");
asm("stw r4, 16(sp)");
asm("stw r5, 20(sp)");
asm("stw r6, 24(sp)");
asm("stw r7, 28(sp)");
asm("stw r8, 32(sp)");
asm("stw r9, 36(sp)");
asm("stw r10, 40(sp)");
asm("stw r11, 44(sp)");
asm("stw r12, 48(sp)");
asm("stw r13, 52(sp)");
asm("stw r14, 56(sp)");
asm("stw r15, 60(sp)");
asm("stw r16, 64(sp)");
asm("stw r17, 68(sp)");
asm("stw r18, 72(sp)");
asm("stw r19, 76(sp)");
asm("stw r20, 80(sp)");
asm("stw r21, 84(sp)");
asm("stw r22, 88(sp)");
asm("stw r23, 92(sp)");
asm("stw r25, 100(sp)");
asm("stw r26, 104(sp)");
// skip r27 because it is sp, and there is no point in saving this
asm("stw r28, 112(sp)");
asm("stw r29, 116(sp)");
asm("stw r30, 120(sp)");
asm("stw r31, 124(sp)");
asm("addi fp, sp, 128");
asm("call  interrupt_handler");
asm("ldw r1, 4(sp)"); // Restore all registers 
asm("ldw r2, 8(sp)");
asm("ldw r3, 12(sp)");
asm("ldw r4, 16(sp)");
asm("ldw r5, 20(sp)");
asm("ldw r6, 24(sp)");
asm("ldw r7, 28(sp)");
asm("ldw r8, 32(sp)");
asm("ldw r9, 36(sp)");
asm("ldw r10, 40(sp)");
asm("ldw r11, 44(sp)");
asm("ldw r12, 48(sp)");
asm("ldw r13, 52(sp)");
asm("ldw r14, 56(sp)");
asm("ldw r15, 60(sp)");
asm("ldw r16, 64(sp)");
asm("ldw r17, 68(sp)");
asm("ldw r18, 72(sp)");
asm("ldw r19, 76(sp)");
asm("ldw r20, 80(sp)");
asm("ldw r21, 84(sp)");
asm("ldw r22, 88(sp)");
asm("ldw r23, 92(sp)");
asm("ldw r24, 96(sp)");
asm("ldw r25, 100(sp)");
asm("ldw r26, 104(sp)");
asm("ldw r28, 112(sp)");
asm("ldw r29, 116(sp)");
asm("ldw r30, 120(sp)");
asm("ldw r31, 124(sp)");
asm("addi sp, sp, 128");
asm("eret");
}

